import React, {useState} from 'react';
import { makeStyles } from '@material-ui/core/styles';
import Drawer from '@material-ui/core/Drawer';
import CssBaseline from '@material-ui/core/CssBaseline';
import List from '@material-ui/core/List';
import ListItem from '@material-ui/core/ListItem';
import ListItemIcon from '@material-ui/core/ListItemIcon';
import ListItemText from '@material-ui/core/ListItemText';
import InboxIcon from '@material-ui/icons/MoveToInbox';
import SendIcon from '@material-ui/icons/Send';
import DraftsIcon from '@material-ui/icons/Drafts';
// import PersistentDrawerLeft from "./PersistentDrawerLeft";


const drawerWidth = 250;

const useStyles = makeStyles((theme) => ({
    root: {
        display: 'flex',
    },
    appBar: {
        width: `calc(100% - ${drawerWidth}px)`,
        marginLeft: drawerWidth,
    },
    drawer: {
        width: drawerWidth,
        flexShrink: 0,
        height: 'calc(100% - 64px)',

    },
    drawerPaper: {
        width: drawerWidth,
    },
    // necessary for content to be below app bar
    toolbar: theme.mixins.toolbar,
    content: {
        flexGrow: 1,
        backgroundColor: theme.palette.background.default,
        padding: theme.spacing(3),
    },
}));

const AdminPage = () => {
    const classes = useStyles();
    const [component, setComponent] = useState('user');


    return (
        <div>
            <div className={classes.root}>
            <CssBaseline />
            <Drawer
            className={classes.drawer}
            variant="permanent"
            classes={{
            paper: classes.drawerPaper,
            }}
            anchor="left"
            >
            <div className={classes.toolbar} />
            <List>
                <ListItem button onClick={() => setComponent('applications')}>
                <ListItemIcon>
                <SendIcon />
                </ListItemIcon>
                <ListItemText primary="Applications" />
                </ListItem>

                <ListItem button onClick={() => setComponent('tour reservations')}>
                    <ListItemIcon>
                        <DraftsIcon />
                    </ListItemIcon>
                    <ListItemText primary="Tour reservations" />
                </ListItem>


                <ListItem button onClick={() => setComponent('customer Emails')}>
                <ListItemIcon>
                <DraftsIcon />
                </ListItemIcon>
                <ListItemText primary="Customer Emails" />
                </ListItem>
                <ListItem button onClick={() => setComponent('maintenance requests')}>
                <ListItemIcon>
                <InboxIcon />
                </ListItemIcon>
                <ListItemText primary="Maintenance requests" />
                </ListItem>
            </List>
            </Drawer>
            <main className={classes.content}>
            <div className={classes.toolbar} />
            {
                component === 'application' ?
                    <p>Applications</p>
                :
                component === 'maintenance' ?
                    <AdminMaintenance/>
                :
                component === 'tour reservations' ?
                    <AdminMaintenance/>
                :
                    <AdminMaintenance/>
            }

            </main>
            </div>
        </div>

    );
}

export default AdminPage;






